import React, { Component, Fragment } from 'react';
import axios from 'axios';
import Pusher from 'pusher-js';
import Layout from '../components/Layout';

class IndexPage extends Component {

  render() {
    return (
      <Layout pageTitle="Realtime Data Visualization">
        <main className="container-fluid position-absolute h-100 bg-light">
          <div className="row" className="row position-absolute w-100 h-100">
            <div id="hello"> hello my name is benny</div>
          </div>
        </main>
      </Layout>
    );
  }

}

export default () => (
  <Fragment>
    <IndexPage />
  </Fragment>
);
